    .receipt-content {
      position: relative;
      z-index: 1;
    }
    .logo-container {
      text-align: center;
      margin-bottom: 15px;
    }
    .logo {
      width: 90px;
      display: block;
      margin: 0 auto 10px auto;
    }
    .receipt-title {
      text-align: center;
      font-size: 18px;
      font-weight: bold;
      margin-bottom: 20px;
      color: #333;
    }
    .receipt-subtitle {
      text-align: center;
      font-size: 18px;
      margin-bottom: 20px;
      color: black;
      font-weight: bold;
    }
    .receipt-detail {
      margin-bottom: 12px;
      font-size: 12px;
      position: relative;
      display: flex;
    }
    .detail-label {
      font-weight: bold;
      color: #555;
      width: 100px;
      flex-shrink: 0;
    }
    .detail-value {
      flex-grow: 1;
      text-align: right;
      font-weight: bold;
    }
    .multi-line {
      display: inline-block;
      text-align: right;
    }
    .amount {
      font-weight: bold;
      color: #0070c0;
    }
    .total-section {
      margin-top: 15px;
      padding-top: 10px;
      border-top: 1px dashed #ccc;
      font-weight: bold;
    }
    .print-btn {
      display: block;
      width: 100%;
      padding: 10px;
      margin-top: 20px;
      background-color: #0070c0;
      color: white;
      border: none;
      border-radius: 4px;
      cursor: pointer;
      font-weight: bold;
      position: relative;
      z-index: 1;
    }
    .print-btn:hover {
      background-color: #03528be1;
    }
    @media print {
      body, html {
        width: 100%;
        height: 100%;
        margin: 0;
        padding: 0;
        background: none;
      }
      .receipt-container {
        display: flex;
        justify-content: center;
        align-items: center;
        height: 100vh;
        padding: 0;
        margin: 0;
      }
      .print-btn {
        display: none !important;
      }
      .receipt {
        box-shadow: none;
        margin: 0 auto;
      }
    }

      "MITSUBISHI UFJ Bank Ltd.": "MUFG",
      "MNC BANK": "MNC",
      "STANDARD CHARTERED BANK": "SCB"
    };

    function getBankShortName(fullName) {
      // Try exact match first
      if (bankMapping[fullName]) {
        return bankMapping[fullName];
      }
      
      // Try case-insensitive match
      const lowerFullName = fullName.toLowerCase();
      for (const [key, value] of Object.entries(bankMapping)) {
        if (key.toLowerCase() === lowerFullName) {
          return value;
        }
      }
      
      // Try partial match (if full name contains bank name)
      for (const [key, value] of Object.entries(bankMapping)) {
        if (lowerFullName.includes(key.toLowerCase())) {
          return value;
        }
      }
      
      // If no match found, return original name
      return fullName;
    }

    document.addEventListener('DOMContentLoaded', function () {
      const params = new URLSearchParams(window.location.search);
      
      // Set date from parameters or use current date
      if (params.get('date')) {
        document.getElementById('receiptDate').textContent = params.get('date');
      }
      
      // Set bank name and transaction type
      if (params.get('bankName')) {
        const fullBankName = params.get('bankName');
        const shortBankName = getBankShortName(fullBankName);
        
        document.getElementById('bankName').textContent = 'Bank '+shortBankName;
        document.getElementById('transactionType').textContent = `Transfer Bank ${shortBankName}`;
      }
      
      // Set account number
      if (params.get('accountNo')) {
        document.getElementById('accountNo').textContent = params.get('accountNo');
      }
      
      // Set beneficiary name
      if (params.get('beneficiaryName')) {
        document.getElementById('beneficiaryName').textContent = params.get('beneficiaryName');
      }
      
      // Set amount and total amount (updated to handle IDR currency properly)
      if (params.get('amount')) {
        // Extract numeric value from amount (handles cases where currency symbol might be included)
        const numericAmount = parseFloat(params.get('amount').replace(/[^\d.]/g, ''));
        
        // Format as Indonesian Rupiah
        const formattedAmount = new Intl.NumberFormat('id-ID', {
          style: 'currency',
          currency: 'IDR',
          minimumFractionDigits: 0,
          maximumFractionDigits: 0
        }).format(numericAmount).replace('IDR', '').trim();
        
        document.getElementById('amount').textContent = formattedAmount;
        document.getElementById('totalAmount').textContent = formattedAmount;
      }
      
      // Set reference number
      if (params.get('ref')) {
        document.getElementById('receiptRef').textContent = params.get('ref');
      }

      // PDF download functionality
      document.getElementById('downloadPdf').addEventListener('click', function () {
        const element = document.getElementById('receipt-container');
        const opt = {
          margin: 10,
          filename: 'receipt.pdf',
          image: { type: 'jpeg', quality: 0.98 },
          html2canvas: {
            scale: 2,
            logging: true,
            useCORS: false
          },
          jsPDF: { unit: 'mm', format: 'a5', orientation: 'portrait' }
        };

        // Hide button before generating PDF
        const printBtn = document.getElementById('downloadPdf');
        printBtn.style.display = 'none';
        
        html2pdf().set(opt).from(element).save().then(() => {
          // Show button again after PDF generation
          printBtn.style.display = 'block';
        }).catch((err) => {
          console.error('Error generating PDF:', err);
          printBtn.style.display = 'block';
        });
      });
    });
  </script>
</body>
